/** Enum мышечных групп, соответствует серверному MuscleGroup enum */
const MuscleGroup = {
    FullBody: 0,
    Chest: 1,
    Back: 2,
    Shoulders: 3,
    Biceps: 4,
    Triceps: 5,
    Forearms: 6,
    Abs: 7,
    Glutes: 8,
    Quadriceps: 9,
    Hamstrings: 10,
    Calves: 11
};

/**
 * Маппит числовое/строковое значение мышечной группы в ключ muscleAscii.
 * @param {number|string} muscleGroupValue — значение enum или строковое название
 * @returns {string} ключ для muscleAscii объекта
 */
function mapMuscleGroupToKey(muscleGroupValue) {
    if (typeof muscleGroupValue === 'number') {
        switch (muscleGroupValue) {
            case MuscleGroup.Chest:
                return 'chest';
            case MuscleGroup.Back:
                return 'back';
            case MuscleGroup.Shoulders:
                return 'shoulders';
            case MuscleGroup.Biceps:
                return 'biceps';
            case MuscleGroup.Triceps:
                return 'triceps';
            case MuscleGroup.Forearms:
                return 'arms';
            case MuscleGroup.Abs:
                return 'core';
            case MuscleGroup.Glutes:
            case MuscleGroup.Quadriceps:
            case MuscleGroup.Hamstrings:
            case MuscleGroup.Calves:
                return 'legs';
            case MuscleGroup.FullBody:
            default:
                return 'core';
        }
    }
    
    if (typeof muscleGroupValue === 'string') {
        const lower = muscleGroupValue.toLowerCase();
        if (lower === 'chest') return 'chest';
        if (lower === 'back') return 'back';
        if (lower === 'shoulders') return 'shoulders';
        if (lower === 'biceps') return 'biceps';
        if (lower === 'triceps') return 'triceps';
        if (lower === 'forearms' || lower === 'arms') return 'arms';
        if (lower === 'abs' || lower === 'core') return 'core';
        if (lower === 'glutes' || lower === 'quadriceps' || lower === 'hamstrings' || lower === 'calves' || lower === 'legs') return 'legs';
        return 'core';
    }
    
    return 'core';
}

